import base64
from PIL import Image
from io import BytesIO

# Function to convert base64 image to a file


def convert_base64_to_file(base64_data, output_path):
    # Decode the base64 data
    image_data = base64.b64decode(base64_data)

    # Open the image using PIL (Pillow) library
    image = Image.open(BytesIO(image_data))

    # Save the image to the specified file path
    image.save(output_path)
    print(f"Image successfully converted and saved to {output_path}")


# Sample usage
base64_image = 'data:image/jpeg;base64,'  # Replace this with your actual base64 image data
output_file_path = 'output.jpg'  # Replace this with your desired output file path

convert_base64_to_file(base64_image.split(',')[1], output_file_path)
